My thoughts about #lehmberginni 
Must watch for families, youth and all Punjabis! Real portrayal of a Punjabi family!
- Entertaining and straight arrow at how telling lies becomes second nature!
- How faith and promises are kept
- How truthful love triumphs all!

- Fantastic acting by @ranjitbawa @officialmahirasharma @nirmalrishiofficial - never seen before avatar @sarbjitcheemaofficial, @ishivam.sharma 
- Fantastic Music @jaidevkumar_jd @oyekunaal6 
- beautifully directed by @adv_ishanchopra

